import React, { Component } from 'react';

class ViewAll extends Component {


    render() {
        return(
            <div>
                <button style={{"margin": "auto",
                 "display": "inline-block",
                "width": "5%",
                "padding": "30px",
                "color": "green"}}>View All Stocks</button>
            </div>
        )
    }
}

export default ViewAll;
